syntax = "proto3";



import "Uint32Pair.proto";

message DungeonEntryInfoReq {
	enum EHLGNPMDHDF {
		option allow_alias = true;
		NONE = 0;
		PEPPOHPHJOJ = 905;
		DCDNILFDFLB = 0;
		NNBKOLMPOEA = 1;
		EAJIABGAOCI = 1;
	}

	uint32 pointId = 14;
	repeated Uint32Pair scenePointIdList = 12;
	uint32 sceneId = 3;
}
